import React from 'react'
import axios from 'axios'

function Read() {
    const [data, setData] = useState([])
    const { id } = useParams()
    useEffect(() => {
        axios(`/student/${id}`)
        .then((res) => {
            console.log(res.data)
            setData(res.data)
        })
        .catch((err) => console.log(err))
    })
    return (
        <div>Read</div>
    )
}

export default Read
